tables.table_schema:
CREATE TABLE atm_transactions (
    transaction_id INT PRIMARY KEY,
    atm_id INT,
    amount DECIMAL(10, 2),
    transaction_date TIMESTAMP
);

CREATE TABLE atm_audit_logs (
    log_id INT PRIMARY KEY,
    transaction_id INT,
    log_timestamp TIMESTAMP,
    status VARCHAR(10)
);

CREATE TABLE atm_users (
  user_id INT PRIMARY KEY,
  user_name VARCHAR(100),
  user_type VARCHAR(50),
  registration_date DATE
);

CREATE TABLE atm_locations (
  location_id INT PRIMARY KEY,
  location_name VARCHAR(255),
  location_address VARCHAR(255)
);

CREATE TABLE atm_transaction (
  transaction_id INT PRIMARY KEY,
  account_number INT,
  withdrawal_amount DECIMAL(10, 2),
  transaction_date DATE
);

CREATE TABLE atm_location (
  location_id INT PRIMARY KEY,
  location_name VARCHAR(50),
  city VARCHAR(50),
  state VARCHAR(2)
);

CREATE TABLE atm_customer (
  customer_id INT PRIMARY KEY,
  customer_name VARCHAR(50),
  address VARCHAR(100),
  phone_number VARCHAR(15)
);

CREATE TABLE atm_bank (
  bank_id INT PRIMARY KEY,
  bank_name VARCHAR(50),
  routing_number VARCHAR(10),
  headquarters_city VARCHAR(50)
);

CREATE TABLE atm_audit_log (
  log_id INT PRIMARY KEY,
  transaction_id INT,
  operation VARCHAR(10),
  audit_date DATE
);
